import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./Components/Login";
import { useState, useEffect } from "react";
import { getUsers } from "./Services/UsersService";
import { getAdmins } from "./Services/AdminsService";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import Register from "./Components/Register";

function App() {
  const [logged, setLogged] = useState(false);
  const [users, setUsers] = useState([]);
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    getUsers().then((res) => {
      setUsers(res.data);
    });

    getAdmins().then((res) => {
      setAdmins(res.data);
    });
  }, []);

  const handleLogged = () => {
    setLogged(true);
  };

  return (
    <div>
      {!logged ? (
        <Login users={users} admins={admins} handleLogged={handleLogged} />
      ) : (
        <Router>
          <Routes>
            <Route
              exact
              path="/"
              element={
                <Login
                  users={users}
                  admins={admins}
                  handleLogged={handleLogged}
                />
              }
            />

            {logged && <Route exact path="/admin" element={<Header />} />}
            {logged && <Route exact path="/user" element={<Footer />} />}
            {logged && <Route exact path="/register" element={<Register />} />}
          </Routes>
        </Router>
      )}
    </div>
  );
}

export default App;
